
    CREATE TABLE dados (
        id INT PRIMARY KEY,
        Nome VARCHAR(50),
        SobreNome VARCHAR(50),
        Sexo VARCHAR(10),
        DataNascimento DATE,
        FormacaoAcademica VARCHAR(50),
        Cargo VARCHAR(50),
        SalarioAnual DECIMAL(10,2),
        Cidade VARCHAR(50),
        Estado VARCHAR(2)
    );
    
